fn query_balance<S: Storage, A: Api,
                 Q: Querier>(&Extern<S, A, Q>, String, HumanAddr)
-> StdResult<BalanceResponse>

fn query_archived<S: Storage, A: Api,
                  Q: Querier>(&Extern<S, A, Q>, String, i64)
-> StdResult<ArchivedResponse>

fn query_transfer_agreement<S: Storage, A: Api,
                            Q: Querier>(&Extern<S, A, Q>, String, i64)
-> StdResult<AgreementResponse>

pub enum Extension {
    WhiteListExtension {
        moderators: Vec<HumanAddr>,
    },
    TaxableExtension {
        tax: Fee,
        receivers: Vec<HumanAddr>,
    },
    RoyaltiesExtension {
        fee: Fee,
        receivers: Vec<HumanAddr>,
    },
}

pub enum HandleMsg {
    Create {
        name: String,
        symbol: String,
        extensions: Vec<Extension>,
    },
    Mint {
        collection_symbol: String,
        token_id: i64,
    },
    Transfer {
        collection_symbol: String,
        from: HumanAddr,
        to: HumanAddr,
        token_id: i64,
    },
    Burn {
        collection_symbol: String,
        token_id: i64,
    },
    Archive {
        collection_symbol: String,
        token_id: i64,
    },
    CreateTransferAgreement {
        collection_symbol: String,
        token_id: i64,
        denom: String,
        amount: Uint128,
        purchaser: HumanAddr,
    },
    Whitelist {
        collection_symbol: String,
        address: HumanAddr,
    },
    Dewhitelist {
        collection_symbol: String,
        address: HumanAddr,
    },
}

pub enum QueryMsg {
    GetName {
        collection_symbol: String,
    },
    GetBalance {
        collection_symbol: String,
        address: HumanAddr,
    },
    GetOwner {
        collection_symbol: String,
        token_id: i64,
    },
    GetArchived {
        collection_symbol: String,
        token_id: i64,
    },
    GetTransferAgreement {
        collection_symbol: String,
        token_id: i64,
    },
    GetExtensions {
        collection_symbol: String,
    },
    GetWhitelisted {
        collection_symbol: String,
        address: HumanAddr,
    },
}

fn create_transfer_agreement<S: Storage>(&Self, &mut S, &i64, String, Uint128,
                                         HumanAddr)
-> StdResult<TransferAgreement>
